import { Table } from "react-bootstrap";

import api from "../../services/api";



interface IDoctor{
  nome: string;
  crm: number;
  telcelular:number;
  telfixo:number;
  bairro:string;
  uf:string;
  localidade:string;



}


const Doctors: React.FC = () => {


    const [doctors,setDoctors] = useState([]);

    useEffect(()=>{
        loadDoctors();
    },[])

    async function loadDoctors(){
        const response = await api.get('/InfoDoctors/')
        console.log(response);

        setDoctors(response.data);
    }

  return (
    <div className="container">
      <br />
      <h1>Medicos</h1>
      <br />
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Nome</th>
            <th>CRM</th>
            <th>Tel. Celular</th>
            <th>Tel. Fixo</th>
            <th>Bairro</th>
            <th>Cidade</th>
            <th>Estado</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {
            doctors.map(doctor =>(
              <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            ))

          }

        </tbody>
      </Table>
    </div>
  );
};

export default Doctors;
